import Home from '../pages/Home';
import PlayerPropsAssists from '../pages/playerPropsAssists';
import H2hSpreadTotal from '../pages/h2hSpreadTotal';
import PlayerPropsRebounds from '../pages/playerPropsRebounds';
import PlayerPropsPoints from '../pages/playerPropsPoints';
import { Box, Flex, Link, Spacer } from '@chakra-ui/react';
import { Routes, Route, Link as RouterLink } from 'react-router-dom';

const App = () => {
  return (
    <Box p={4}>
      {/* Navigation Bar */}
      <Flex as="nav" mb={6} align="center" justify="space-between">
        <Flex>
          <Link as={RouterLink} href="/" p={2} fontSize="lg" fontWeight="bold">
            Home
          </Link>
          <Link as={RouterLink} href="/h2h-spread-total" p={2} fontSize="lg">
            H2H - Spreads - Totals
          </Link>
          <Link as={RouterLink} href="/player-props-assists" p={2} fontSize="lg">
            Player Props - Assists
          </Link>
          <Link as={RouterLink} href="/player-props-rebounds" p={2} fontSize="lg">
            Player Props - Rebounds
          </Link>
          <Link as={RouterLink} href="/player-props-points" p={2} fontSize="lg">
            Player Props - Points
          </Link>
        </Flex>
        {/* Optional Spacer for better alignment */}
        <Spacer />
      </Flex>

      {/* Routes */}
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/h2h-spread-total" element={<H2hSpreadTotal />} />
        <Route path="/player-props-assists" element={<PlayerPropsAssists />} />
        <Route path="/player-props-rebounds" element={<PlayerPropsRebounds />} />
        <Route path="/player-props-points" element={<PlayerPropsPoints />} />
      </Routes>
    </Box>
  );
};

export default App;
